import React, { useState } from 'react';

function App() {
  // State to store the backend output
  const [backendOutput, setBackendOutput] = useState('');

  const handleButtonClick = () => {
    fetch('/run-backend')
      .then(response => response.json())
      .then(data => {
        // alert(data.message);  // alert the message for debugging
        setBackendOutput(data.output);  // Update the state with the backend output
      })
      .catch(error => console.error('Error:', error));
  };

  return (
    <div className="App">
      <header className="App-header">
        <button onClick={handleButtonClick}>Display Queries</button>
        {/* Display the backend output */}
        <pre>{backendOutput}</pre>
      </header>
    </div>
  );
}

export default App;
